import React from 'react';
import Input from '@material-ui/core/Input';
import IconButton from '@material-ui/icons/Add';
import AddIcon from '@material-ui/icons/Add';


export class TodoInput extends React.Component {

    constructor(props) {
        super(props);
        this.state = { value: '' }
    }

    handleChange = (event) => {
        this.setState({ value: event.target.value })
    }

    handleSubmit = (event) => {

        if (event.target.value === '') {
            return;
        }

        if (event.key === 'Enter') {
            event.preventDefault();
            this.props.create(this.state.value);
            event.target.value = '';
        }
    } 

  render() {
   return (
   <div className="allTodoAdd">
    <Input 
      onKeyPress = {this.handleSubmit}
      onChange = {this.handleChange} 
      className ="allTodoInput" placeholder="Enter your task" 
      inputProps = {{ 'aria-label': 'description' }}  
    />

    <IconButton aria-label="Linkedin.com" onClick={() => window.open('https://www.Linkedin.com')}>
      <AddIcon />
    </IconButton>
   </div>);
  }
};

export default TodoInput;
